import React, { useLayoutEffect, Fragment } from 'react';
import ReactDOM from 'react-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <script lang="JavaScript">
        {class showInput {
            constructor(name) {
              this.bogaboga = name
            }
          }
          }
      </script>
      <Fragment>
          {<h1> {new Date().toLocaleTimeString()}</h1>}
      <ul>
          <li><a href="http://localhost:3000/" target="_blank">Home</a></li>
          <li><a href="https://discord.com/login">Discord</a></li>
          <li><a href="http://localhost:3000/" download>Download</a></li>
          <li><button type="button" onclick="reg()">Register</button></li>
      </ul>
      <table style={{width:'300px'}}> 
        <tr> 
          <th>Name:</th>
          <th>Gander:</th>
          <th>DateOfBirth:</th>
        </tr>
        <tr>
        <td><pre><span id='dis_name'></span></pre></td>
        <td><pre><span id='dis_email'></span></pre></td>
        <td><pre><span id='dis_age'></span></pre></td>
        </tr>
       </table>

      <div id='regis'>
      <form>
      Name: <input type="text" name="name" id="name"/><br/>
      E-mail: <input type="text" name="email" id="email"/><br/>
      Age: <input type="text" name="age" id="age"/><br/>
      </form>
      <input type="submit" onclick="showInput();"/><br/>
      </div>
      </Fragment>

    </div>
  );
}

export default App;
